import React from 'react';
import logo from '../images/logo.png';
import {Link} from 'react-router-dom';


function footer() {
  return (
    <footer>
        <div className="container">
        <Link to={'/'}>
            <img src={logo} alt='logo' draggable='false'></img>
            </Link>
        </div>
    </footer>
  )
}

export default footer
